クリアメニューブックの形は、業態を問わず、様々なお店にマッチするスタンダードなタイプです。<br>テーピング部分には布の入ったウレタン合皮を使用しているため、耐久性に優れています。<br>クリア部分には、透明性と耐衝撃性に優れ、燃焼によるダイオキシンの発生がない、ポリエチレンテレフタレート(ペット材)を使用しています。<br>少し大きめのコーナー金具は、余分な厚みを防ぐため薄型を使用。重ねた際に安定感があります。<br>ステッチングは折り返し縫いにより、切り目・引っかかりなどのトラブルを解消、美しく丈夫です。<br><br>


